PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "data_category" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "px_id" integer NOT NULL, "name" varchar(255) NOT NULL, "ru_name" varchar(255) NOT NULL, "px_slug" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "data_offerdetail" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "px_id" varchar(255) NOT NULL, "feedback_negative" integer NOT NULL, "feedback_positive" integer NOT NULL, "predefined_amount" text NOT NULL CHECK ((JSON_VALID("predefined_amount") OR "predefined_amount" IS NULL)), "fiat_amount_range_min" integer NOT NULL, "fiat_amount_range_max" integer NOT NULL, "fiat_price_per_btc" real NOT NULL, "price_per_btc" real NOT NULL, "fee_percentage" integer NOT NULL, "payment_method_group_id" integer NOT NULL, "percent_per_usd" real NOT NULL, "require_full_name_visibility" bool NOT NULL, "default_flow_type" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "data_tag" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "px_id" integer NOT NULL, "name" varchar(255) NOT NULL, "description" varchar(1025) NOT NULL, "px_slug" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "data_subcategory" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "px_id" integer NOT NULL, "name" varchar(255) NOT NULL, "ru_name" varchar(255) NOT NULL, "px_slug" varchar(255) NOT NULL, "category_id" bigint NOT NULL REFERENCES "data_category" ("id") DEFERRABLE INITIALLY DEFERRED, "faq" varchar(1000) NULL);
CREATE TABLE IF NOT EXISTS "data_offer_tags" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "offer_id" bigint NOT NULL REFERENCES "data_offer" ("id") DEFERRABLE INITIALLY DEFERRED, "tag_id" bigint NOT NULL REFERENCES "data_tag" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_celery_beat_intervalschedule" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "every" integer NOT NULL, "period" varchar(24) NOT NULL);
CREATE TABLE IF NOT EXISTS "django_celery_beat_periodictasks" ("ident" smallint NOT NULL PRIMARY KEY, "last_update" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_celery_beat_solarschedule" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "event" varchar(24) NOT NULL, "latitude" decimal NOT NULL, "longitude" decimal NOT NULL);
CREATE TABLE IF NOT EXISTS "django_celery_beat_periodictask" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(200) NOT NULL UNIQUE, "task" varchar(200) NOT NULL, "args" text NOT NULL, "kwargs" text NOT NULL, "queue" varchar(200) NULL, "exchange" varchar(200) NULL, "routing_key" varchar(200) NULL, "expires" datetime NULL, "enabled" bool NOT NULL, "last_run_at" datetime NULL, "total_run_count" integer unsigned NOT NULL CHECK ("total_run_count" >= 0), "date_changed" datetime NOT NULL, "description" text NOT NULL, "crontab_id" integer NULL REFERENCES "django_celery_beat_crontabschedule" ("id") DEFERRABLE INITIALLY DEFERRED, "interval_id" integer NULL REFERENCES "django_celery_beat_intervalschedule" ("id") DEFERRABLE INITIALLY DEFERRED, "solar_id" integer NULL REFERENCES "django_celery_beat_solarschedule" ("id") DEFERRABLE INITIALLY DEFERRED, "one_off" bool NOT NULL, "start_time" datetime NULL, "priority" integer unsigned NULL CHECK ("priority" >= 0), "headers" text NOT NULL, "clocked_id" integer NULL REFERENCES "django_celery_beat_clockedschedule" ("id") DEFERRABLE INITIALLY DEFERRED, "expire_seconds" integer unsigned NULL CHECK ("expire_seconds" >= 0));
CREATE TABLE IF NOT EXISTS "django_celery_beat_clockedschedule" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "clocked_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_celery_beat_crontabschedule" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "minute" varchar(240) NOT NULL, "hour" varchar(96) NOT NULL, "day_of_week" varchar(64) NOT NULL, "day_of_month" varchar(124) NOT NULL, "month_of_year" varchar(64) NOT NULL, "timezone" varchar(63) NOT NULL);
CREATE TABLE IF NOT EXISTS "django_celery_results_groupresult" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" varchar(255) NOT NULL UNIQUE, "date_created" datetime NOT NULL, "date_done" datetime NOT NULL, "content_type" varchar(128) NOT NULL, "content_encoding" varchar(64) NOT NULL, "result" text NULL);
CREATE TABLE IF NOT EXISTS "django_celery_results_chordcounter" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "sub_tasks" text NOT NULL, "count" integer unsigned NOT NULL CHECK ("count" >= 0), "group_id" varchar(255) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "django_celery_results_taskresult" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "task_id" varchar(255) NOT NULL UNIQUE, "status" varchar(50) NOT NULL, "content_type" varchar(128) NOT NULL, "content_encoding" varchar(64) NOT NULL, "result" text NULL, "date_done" datetime NOT NULL, "traceback" text NULL, "meta" text NULL, "task_args" text NULL, "task_kwargs" text NULL, "task_name" varchar(255) NULL, "date_created" datetime NOT NULL, "worker" varchar(100) NULL, "periodic_task_name" varchar(255) NULL);
CREATE TABLE IF NOT EXISTS "data_tguser" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "tg_id" integer NOT NULL, "username" varchar(255) NOT NULL, "first_name" varchar(255) NOT NULL, "native_language_code" varchar(2) NOT NULL, "language_code" varchar(2) NULL, "currency" varchar(3) NULL, "is_bot" bool NOT NULL, "is_admin" bool NOT NULL, "is_active" bool NOT NULL, "chat_id" integer NULL);
CREATE TABLE IF NOT EXISTS "data_paymentmethod" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NOT NULL, "display_name" varchar(255) NOT NULL, "description" text NULL, "api_key_conf" varchar(128) NULL, "is_active" bool NOT NULL, "secret_key_conf" varchar(128) NULL);
CREATE TABLE IF NOT EXISTS "data_currencydetail" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "country" varchar(128) NULL, "type" varchar(50) NOT NULL, "code" varchar(10) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "data_paymentaddress" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(510) NOT NULL, "address" varchar(255) NOT NULL, "is_active" bool NOT NULL, "payment_method_id" bigint NULL REFERENCES "data_paymentmethod" ("id") DEFERRABLE INITIALLY DEFERRED, "network" varchar(255) NULL);
CREATE TABLE IF NOT EXISTS "data_giftorder" ("id" char(32) NOT NULL UNIQUE, "discount" real NOT NULL, "amount" integer NOT NULL, "offer_id" bigint NULL REFERENCES "data_offer" ("id") DEFERRABLE INITIALLY DEFERRED, "tg_user_id" bigint NOT NULL REFERENCES "data_tguser" ("id") DEFERRABLE INITIALLY DEFERRED, "created_at" datetime NOT NULL, "price" real NULL, "callback_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "TxID" varchar(255) NULL, "payment_status_id" bigint NULL REFERENCES "data_paymentstatus" ("id") DEFERRABLE INITIALLY DEFERRED, "payment_address_id" bigint NULL REFERENCES "data_paymentaddress" ("id") DEFERRABLE INITIALLY DEFERRED, "gift_code" varchar(255) NULL);
CREATE TABLE IF NOT EXISTS "data_paymentstatus" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "description" text NULL, "ru_name" varchar(128) NOT NULL, "name" varchar(128) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "data_payment" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "amount" real NOT NULL, "payment_id" integer NULL REFERENCES "data_giftorder" ("callback_id") DEFERRABLE INITIALLY DEFERRED, "tg_user_id" bigint NULL REFERENCES "data_tguser" ("id") DEFERRABLE INITIALLY DEFERRED, "TxID" varchar(255) NULL, "_type" varchar(255) NOT NULL, "bc_id" varchar(255) NULL, "insert_time" varchar(255) NOT NULL, "status" bool NULL, "payment_address_id" bigint NULL REFERENCES "data_paymentaddress" ("id") DEFERRABLE INITIALLY DEFERRED, "currency" varchar(255) NULL, "fiat_amount" real NULL);
CREATE TABLE IF NOT EXISTS "data_offer" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "px_id" varchar(255) NOT NULL, "sell_cur" varchar(128) NOT NULL, "buy_cur" varchar(128) NOT NULL, "margin" real NOT NULL, "price_per_cur" real NOT NULL, "require_verified_id" bool NOT NULL, "payment_method_label" varchar(255) NOT NULL, "username" varchar(255) NOT NULL, "score" real NOT NULL, "last_seen" varchar(255) NOT NULL, "average_trade_speed" varchar(255) NOT NULL, "user_timezone" varchar(255) NOT NULL, "offer_type" varchar(128) NOT NULL, "category_id" bigint NOT NULL REFERENCES "data_category" ("id") DEFERRABLE INITIALLY DEFERRED, "offer_detail_id" bigint NOT NULL UNIQUE REFERENCES "data_offerdetail" ("id") DEFERRABLE INITIALLY DEFERRED, "subcategory_id" bigint NOT NULL REFERENCES "data_subcategory" ("id") DEFERRABLE INITIALLY DEFERRED, "description" text NULL, "warranty" varchar(255) NULL, "currency_ditail_id" bigint NULL REFERENCES "data_currencydetail" ("id") DEFERRABLE INITIALLY DEFERRED, "created_at" datetime NOT NULL, "is_active" bool NOT NULL);
